let speedY = 0;
let gravity = 0.04823;
let gravitySpeed = 0;
let start = 6;
let y = start;

setInterval(()=>{
  let vox = parcel.getFeatureById("money1");
  gravitySpeed += gravity;
  y -= speedY + gravitySpeed;

  if (y <= 4) {
    y = start;
    gravitySpeed = 0;
  }

  vox.position.y = y;
}, 100)

